// src/pages/MyProducts.js
import React, { useState, useContext, useEffect } from 'react';
import axios from 'axios';
import { UserContext } from '../App';

const MyProducts = () => {
  const { user } = useContext(UserContext);
  const [products, setProducts] = useState([]);
  const [formData, setFormData] = useState({
    name: '',
    category: '',
    location: '',
    quantity: 1,
  });

  const fetchProducts = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/products');
      const userProducts = res.data.filter((p) => p.offeredBy === user.username);
      setProducts(userProducts);
    } catch (error) {
      console.error(error);
    }
  };

  useEffect(() => {
    fetchProducts();
  }, []);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/api/products', {
        ...formData,
        offeredBy: user.username,
      });
      fetchProducts();
      setFormData({
        name: '',
        category: '',
        location: '',
        quantity: 1,
      });
    } catch (error) {
      alert(error.response.data.message || 'Error adding product');
    }
  };

  return (
    <div>
      <h2 className="text-xl font-bold mb-4">My Products</h2>
      <form onSubmit={handleSubmit} className="mb-6">
        <div className="flex flex-col md:flex-row md:space-x-4">
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
            placeholder="Product Name"
            required
            className="mb-4 md:mb-0 px-3 py-2 border rounded w-full"
          />
          <input
            type="text"
            name="category"
            value={formData.category}
            onChange={handleChange}
            placeholder="Category"
            required
            className="mb-4 md:mb-0 px-3 py-2 border rounded w-full"
          />
          <input
            type="text"
            name="location"
            value={formData.location}
            onChange={handleChange}
            placeholder="Location"
            required
            className="mb-4 md:mb-0 px-3 py-2 border rounded w-full"
          />
          <input
            type="number"
            name="quantity"
            value={formData.quantity}
            onChange={handleChange}
            placeholder="Quantity"
            min="1"
            required
            className="mb-4 md:mb-0 px-3 py-2 border rounded w-full"
          />
        </div>
        <button
          type="submit"
          className="mt-4 bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600"
        >
          Add Product
        </button>
      </form>
      <div className="overflow-x-auto">
        <table className="min-w-full bg-white">
          <thead>
            <tr>
              <th className="py-2">Name</th>
              <th className="py-2">Category</th>
              <th className="py-2">Location</th>
              <th className="py-2">Quantity</th>
              <th className="py-2">Created Date</th>
              <th className="py-2">Last Updated</th>
            </tr>
          </thead>
          <tbody>
            {products.map((product) => (
              <tr key={product._id} className="text-center border-t">
                <td className="py-2">{product.name}</td>
                <td className="py-2">{product.category}</td>
                <td className="py-2">{product.location}</td>
                <td className="py-2">{product.quantity}</td>
                <td className="py-2">{new Date(product.createdDate).toLocaleString()}</td>
                <td className="py-2">{new Date(product.lastUpdatedDate).toLocaleString()}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default MyProducts;
